descripcion:
-- rcv1366e-28 --    looking for a house with swimming pool? near to the beach?  this is the property for you! very well located. at just 2 blocks from the ocean!!  very good sizes: living room, dining room, kitchen, laundry room, nice patio with excellent pool and also has a covered parking garage.   second floor with 3 bedrooms, 2 full bathrooms and a beautiful terrace where you will enjoy the gorgeous mazatlan&apos;s s.  this is a unique house!  
&nbsp;  
&nbsp;  
&nbsp;  
&iquest;buscas casa con alberca propia? &iquest;cerca de la playa?  esta es la propiedad que estas buscando: se encuentra a tan solo dos cuadras de la playa con excelente distribuci&oacute;n, sala comedor, cocina de cedro, cuarto de lavander&iacute;a, patio pavimentado con alberca propia de muy buen tama&ntilde;o, cochera techada con port&oacute;n el&eacute;ctrico.   en la segunda plata cuenta con 3 recamaras con sus closets, la principal con ba&ntilde;o completo. adem&aacute;s tiene una amplia terraza donde podr&aacute;s disfrutar los bellos atardeceres de mazatl&aacute;n. quedan pocas propiedades con tanto potencial como esta!  agenda tu cita y ven a conocer esta gran opci&oacute;n!
